DROP TABLE IF EXISTS kraj;
DROP TABLE IF EXISTS okres;
DROP TABLE IF EXISTS psc;

CREATE TABLE kraj
(
  id serial PRIMARY KEY,
  kod character varying,
  nazev character varying
);


CREATE TABLE okres
(
  id serial PRIMARY KEY,
  kod character varying,
  krajid integer REFERENCES kraj (id),
  nazev character varying
);


CREATE TABLE psc
(
  id serial PRIMARY KEY,
  psc character varying,
  nazev character varying,
  nazevposty character varying,
  nazevokresu character varying,
  okresid integer REFERENCES okres (id),
  krajid integer REFERENCES kraj (id)
);

